import React, { Component } from 'react';
import { Button, Image, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import Cook from '../Assets/cook.svg';
import Electricity from '../Assets/electricity.svg';
import Gardener from '../Assets/gardener.svg';
import Housekeeper from '../Assets/housekeeper.svg';
import Location from '../Assets/location.svg';
import Plumbing from '../Assets/plumbing.svg';

type Props = {
    services: [],
    openAddTaskModal: any
}

class Services extends Component<Props> {

    constructor(props: Props) {
        super(props);
        this.renderSwitch = this.renderSwitch.bind(this)
    }

    renderSwitch(name: string) {
        const { openAddTaskModal } = this.props;
        switch (name.toLowerCase()) {
            case 'plumbing':
                return <Button className='webcam-button phone-button' onClick={openAddTaskModal}>
                    <Image src={Plumbing}/>
                </Button>
            case 'cook':
                return <Button className='webcam-button phone-button' onClick={openAddTaskModal}>
                    <Image src={Cook}/>
                </Button>
            case 'electricity':
                return <Button className='webcam-button phone-button' onClick={openAddTaskModal}>
                    <Image src={Electricity}/>
                </Button>
            case 'gardener':
                return <Button className='webcam-button phone-button' onClick={openAddTaskModal}>
                    <Image src={Gardener}/>
                </Button>
            case 'housekeeper':
                return <Button className='webcam-button phone-button' onClick={openAddTaskModal}>
                    <Image src={Housekeeper}/>
                </Button>
            case 'location':
                return <Button className='webcam-button phone-button' onClick={openAddTaskModal}>
                    <Image src={Location}/>
                </Button>
            default:
                return ;
        }
    }

    render() {
        const { services } = this.props;

        return (
            services.map((service: { name:string }, key) => {
                { this.renderSwitch(service.name) }
            })
        );
    }
}

export default Services;
